import * as React from "react";
import Svg, { Rect, Defs, Pattern, Use, Image, SvgProps } from "react-native-svg";
import { ImageStyle, StyleProp } from "react-native";
import { mvs } from "react-native-size-matters";

type Props = {
    /** Tamaño: small / medium / large */
    size?: "sm" | "md" | "lg";
    /** Estilos adicionales para el SVG */
    style?: StyleProp<ImageStyle>;
} & Omit<SvgProps, "width" | "height">; // permitimos pasar cualquier prop de Svg excepto width/height

const sizes = {
    sm: mvs(50, 0.5),
    md: mvs(100, 0.5),
    lg: mvs(150, 0.5),
};

export default function SVGComponent({
                                         size = "sm",
                                         style,
                                         ...restSvgProps
                                     }: Props) {
    // Ancho según el tamaño elegido
    const svgWidth = sizes[size];
    // Altura manteniendo la proporción original (308 / 238)
    const svgHeight = (svgWidth * 308) / 238;

    return (
        <Svg
            width={svgWidth}
            height={svgHeight}
            viewBox="0 0 238 308"
            fill="none"
            style={style}
            xmlns="http://www.w3.org/2000/svg"
            xmlnsXlink="http://www.w3.org/1999/xlink"
            {...restSvgProps}
        >
            <Rect width={238} height={308} fill="url(#pattern0_6034_891)" />
            <Defs>
                <Pattern
                    id="pattern0_6034_891"
                    patternContentUnits="objectBoundingBox"
                    width={1}
                    height={1}
                >
                    <Use
                        xlinkHref="#image0_6034_891"
                        transform="scale(0.00163399 0.00126263)"
                    />
                </Pattern>
                <Image
                    id="image0_6034_891"
                    width={612}
                    height={792}
                    preserveAspectRatio="none"
                    xlinkHref="data:image/png;base64,"
                />
            </Defs>
        </Svg>
    );
}
